import React, { Component } from 'react'

import { Segment, Button } from 'semantic-ui-react';
import '../App.css'

const OpeningPage = (props) => {
	return (
		<Segment id='open-page'>
			<Button id='enter-btn' inverted>Enter</Button>
		</Segment>
	)
}

export default OpeningPage;
